import React from 'react'
import { useState } from "react";
import DestinationCard from "./DestinationCard";
import Filter from "./Filter";

type Destination = {
  id: number;
  name: string;
  location: string;
  rating: number;
  imageUrl: string;
};

type TravelProps = {
  favorites: Destination[];
  setFavorites: (val: Destination[]) => void;
};

const Travel = ({ favorites, setFavorites }: TravelProps) => {
  const destinations: Destination[] = [
    {
      id: 1,
      name: "Nusa Penida Beach",
      location: "Bali",
      rating: 4.8,
      imageUrl: "data:image/jpeg;base64,",
    },
    {
      id: 2,
      name: "Mount Fuji",
      location: "Japan",
      rating: 4.9,
      imageUrl: "data:image/jpeg;base64,",
    },
    {
      id: 3,
      name: "Eiffel Tower",
      location: "France",
      rating: 4.7,
      imageUrl: "data:image/jpeg;base64,",
    },
    {
      id: 4,
      name: "Salar De Uyuni",
      location: "bolivia",
      rating: 5.0,
      imageUrl: "data:image/jpeg;base64,",
    },
      {
      id: 5,
      name: "Grand Canyon",
      location: "US",
      rating: 5.5,
      imageUrl: "data:image/jpeg;base64,",
    },
  ];

  const [selectedLocation, setSelectedLocation] = useState("");
  const [selectedRating, setSelectedRating] = useState(0);

  const addToFavorites = (dest: Destination) => {
    if (!favorites.find((f) => f.id === dest.id)) {
      setFavorites([...favorites, dest]);
    }
  };

  // filter logic
  const filteredDestinations = destinations.filter((d) => {
    const locationMatch = selectedLocation ? d.location === selectedLocation : true;
    const ratingMatch = selectedRating ? d.rating >= selectedRating : true;
    return locationMatch && ratingMatch;
  });

  const uniqueLocations = Array.from(new Set(destinations.map((d) => d.location)));

  return (
    <div className="p-6">
      <h1 className="text-4xl font-bold text-center mb-6 bg-gradient-to-r from-blue-500 to-orange-500 bg-clip-text text-transparent">
        Discover Amazing Places
      </h1>

      <Filter
        selectedLocation={selectedLocation}
        setSelectedLocation={setSelectedLocation}
        selectedRating={selectedRating}
        setSelectedRating={setSelectedRating}
        locations={uniqueLocations}
      />

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {filteredDestinations.map((d) => (
          <DestinationCard
            key={d.id}
            name={d.name}
            location={d.location}
            rating={d.rating}
            imageUrl={d.imageUrl}
          >
            <button
              onClick={() => addToFavorites(d)}
              className="px-3 py-2 bg-blue-500 text-white rounded shadow hover:bg-blue-600"
            >
              Tambah ke Favorit
            </button>
          </DestinationCard>
        ))}
      </div>
    </div>
  );
};

export default Travel;
